L-карнитин — природное вещество в клетках мышц, которое участвует в переносе жирных кислот, впоследствии используемых клеточными митохондриями в качестве энергии. В результате уменьшаются жировые отложения и уменьшается вес. 
Кроме того, согласно исследованиям L-карнитин повышает выносливость у тех, кто занимается спортом. Это происходит благодаря экономии запасов гликогена и уменьшению усталости.
L-карнитин также принимается как антиоксидант и восстановительный продукт.
СВОЙСТВА QUAMTRAX MEGA L-CARNITINE:
* На основе карнитина;
* Способствует сжиганию жира;
* Заряжает энергией;
* Повышает силовой потенциал;
* Ускоряет восстановление после физической нагрузки;
* Поддерживает сердечную деятельность во время тяжелых тренировок.

