Chromium Picolinate - это биологически активный источник чистейшего хрома в виде пиколината хрома. К числу положительных эффектов баланса хрома в организме, как известно, относятся:
формирование и поддержание рельефной мускулатуры без жировой ткани;
стабилизация достигнутого веса после диеты и похудения;
регулирование аппетита и уменьшение тяги к сладкому;
способствование снижению сахара крови и использованию его как топлива для работающей мышцы;
регулирование уровня инсулина - самого сильного анаболического гормона в крови.
Содержание питательных в-в в одной капсуле: 1,67 мг чистейшего кристаллического пиколината хрома, содержащего 200 мкг трехвалентного хрома.
CHROMIUM PICOLINATE SCITEC NUTRITION - это запатентованный продукт.
Способ применения: принимать по 1 капсуле в день в качестве пищевой добавки.
Примечание: страдающим диабетом следует принимать препарат только под наблюдением врача.

